import React from 'react';

const ImageLinkForm = () => {
    return (
        <div>
            <div>
                <div className='f3'/>
                <p>Give it a try!</p>
            </div>
            <div>
                <input type='text' />
                <button>Detect</button>
            </div>
        </div>
    );
}

export default ImageLinkForm
